func marshall(js []byte) (req *Req, err error) {
	if err := json.Unmarshal(js, &req); err != nil {
		return nil, err
	}
	return req, nil
}

func mark(bg, block gocv.Mat, loc image.Point) gocv.Mat {
	colorBG := gocv.NewMat()
	gocv.CvtColor(bg, &colorBG, gocv.ColorGrayToBGR)

	gocv.Rectangle(&colorBG,
		image.Rectangle{loc,
			image.Point{X: loc.X + block.Cols(), Y: loc.Y + block.Rows()}},
		color.RGBA{R: 0, G: 255, B: 0, A: 1}, 1)
	return colorBG
}

func show(img gocv.Mat) {
	window := gocv.NewWindow("")
	for {
		window.IMShow(img)
		if window.WaitKey(1) >= 0 {
			break
		}
	}
}

func TestFail(t *testing.T) {
	req, err := marshall(js)
	if err != nil {
		t.Fatal(err)
	}

	alpha, block, err := preProcess(req.BlockBase64, req.BlockWidth, req.BlockHeight)
	if err != nil {
		t.Fatal(err)
	}
	defer block.Close()

	_, bg, err := preProcess(req.BgBase64, req.BgWidth, req.BgHeight)
	if err != nil {
		t.Fatal(err)
	}
	defer bg.Close()

	loc := match(bg, block, alpha)
	log.Debug(loc)
	marked := mark(bg, block, loc)

	show(marked)
}
